import { getAnalytics } from "firebase/analytics";

import { initializeApp } from 'firebase/app';
import { getAuth, GoogleAuthProvider } from 'firebase/auth';
import { signInWithPopup } from 'firebase/auth';



const firebaseConfig = {
    apiKey: "AIzaSyBM2G3S3mfNc3WgYNX7DtmiHK4RQgEDZ0A",
    authDomain: "hyperlocal-7a895.firebaseapp.com",
    projectId: "hyperlocal-7a895",
    storageBucket: "hyperlocal-7a895.appspot.com",
    messagingSenderId: "764896777820",
    appId: "1:764896777820:web:0eabd2752766790b9b3899",
    measurementId: "G-Y0KV8RJ12C"
  };




const app = initializeApp(firebaseConfig);
const auth = getAuth(app);
const provider = new GoogleAuthProvider();


const analytics = getAnalytics(app);


export { auth, provider, signInWithPopup };
